/* eslint-disable react-hooks/exhaustive-deps */
import axios from "axios";
import { useCallback, useState } from "react";

import { Participant } from "../types/api/Participant";
import { useMessage } from "./useMessage";

export const useAllResult = () => {
  const { showMessage } = useMessage();
  const [usersR1, setUsers1] = useState<String[]>([]);
const [usersR2, setUsers2] = useState<String[]>([]);


  const getResults = useCallback(( tournamentId: number, classes: string[]) => {
    const [className1, className2] = classes;
    console.log("あ"+className1);

    axios
      .get<{ [key: string]: Participant[] }>(`http://localhost:8080/apiTournament/getpreResult?tournamentId=${tournamentId}&className1=${className1}&className2=${className2}`)
      .then((res) => {
        console.log("API Response:", res.data);
        const usersArray1 = res.data[className1] || [];
        const usersArray2 = res.data[className2] || [];
        console.log("usersArray1:", usersArray1);

        setUsers1(usersArray1);
        setUsers2(usersArray2);

      })
      .catch(() => {
        showMessage({ title: "参加者取得に失敗しました", status: "error" });
      })
  }, []);
  return { getResults, usersR1, usersR2 };
};
